import './App.css';
import "react";
import "react-router-dom";

const HomeScreen = lazy(() => import('./pages/Home.js'));

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomeScreen} />
      </Switch>
    </Router>
  );
}

export default App;
